    /**
    Godzilla客户端请求流量解密（发起执行命令的流量）
    客户端的请求流量有两种：
    1、首次请求的时候加载Class文件内容  （这玩意直接urldecode base64decode 然后aes解密就行）
    2、后续发起执行命令，里面主要包含命令执行的参数和需要调用的Class里面的函数 （这段流量 先urldecode base64decode 然后aes解密 最后Gzip解压）
    输入：待解密内容，密钥
    输出：请求命令执行的流量或者是eval.class文件
     */
    public  String deCryptoforGodzillaClienttoServer(String ubdata, String key) throws Exception {
        String base64data = URLDecoder.decode(ubdata);
        base64data = base64data.replaceAll(" ", "+").replace("\n", "").replace("\r", "");
        System.out.println("此内容为客户端发起请求流量，干掉混淆处理完url中+自动转换以及换行问题之后：" + base64data);
        byte[] data = Base64.getDecoder().decode(base64data);

        Cipher cipher = Cipher.getInstance("AES/ECB/PKCS5Padding");
        Key speckey = new SecretKeySpec(key.getBytes(), "AES");
        cipher.init(Cipher.DECRYPT_MODE, speckey);
        byte[] result = cipher.doFinal(data);
        String resultString="";
        try {
            resultString = unSerialize(uncompress(result));
//            System.out.println("非首次解密后内容为：" + resultString);

        } catch (ZipException exs) { //首次加载 需要还原class文件
            System.out.println("改流量为首次连接发起的连接加载Class文件");
            FileOutputStream fos = new FileOutputStream("eval.class");
            fos.write(result);
            resultString = "哥斯拉首次加载客户端请求流量，恶意payload class字节码文件已还原至根目录下 eval.class中";
        }
        return resultString;
    }

    /**
    Godzilla服务端响应流量解密（命令执行响应体流量）
    哥斯拉中服务端响应流量的解密方式：url解码 ——> 干掉头尾的混淆流量 ——> base64解码 ——> aes解码 ——> Gzip解压缩
    输入：待解密流量，密钥，密码
    输入： 命令执行响应流量明文
     */
    public  String deCryptoforGodzillaServertoclient(String text, String key, String pass) throws Exception {
        String mymd5 = md5(pass + key);
        String base64data = URLDecoder.decode(text);
        //判断是否为响应内容
        String base64data016 = base64data.substring(0, 16).toLowerCase();
        if (base64data016.equals(mymd5.substring(0, 16).toLowerCase())) {
            base64data = base64data.substring(16, base64data.length() - 16);
            System.out.println("此内容为响应流量，干掉混淆之后：" + base64data);
        }
        else {return  "请输入正确的密码和密钥参数";}
        base64data = base64data.replaceAll(" ", "+").replace("\n", "").replace("\r", "");
        System.out.println("此内容为响应流量，干掉混淆处理完url中+自动转换以及换行问题之后：" + base64data);
        byte[] data = Base64.getDecoder().decode(base64data);

        Cipher cipher = Cipher.getInstance("AES/ECB/PKCS5Padding");
        Key speckey = new SecretKeySpec(key.getBytes(), "AES");
        cipher.init(Cipher.DECRYPT_MODE, speckey);
        byte[] result = cipher.doFinal(data);
        System.out.println("AES解密后流量："+new String(result));
        String resultString = new String(uncompress(result));
        return "响应流量解密之后："+resultString;
    }

    /**
     * 计算md5前16位的大写
     * @param s
     * @return
     */
    public  String md5(String s) {
        String ret = null;

        try {
            MessageDigest m = MessageDigest.getInstance("MD5");
            m.update(s.getBytes(), 0, s.length());
            ret = (new BigInteger(1, m.digest())).toString(16).toUpperCase();
        } catch (Exception var3) {
        }
        return ret;
    }

    /**
    Gzip解压 用于哥斯拉请求流量解密
     */
    public  byte[] uncompress(byte[] bytes) throws ZipException, IOException {
        if (bytes == null || bytes.length == 0) {
            return null;
        }
        ByteArrayOutputStream out = new ByteArrayOutputStream();
        ByteArrayInputStream in = new ByteArrayInputStream(bytes);
        GZIPInputStream ungzip = new GZIPInputStream(in);
        byte[] buffer = new byte[256];
        int n;
        while ((n = ungzip.read(buffer)) >= 0) {
            out.write(buffer, 0, n);
        }
        return out.toByteArray();
    }
    /**
        Godzilla客户端请求流量反格式化
        输入：Gzip解压之后的原始流量
        输出：哥斯拉构造的明文命令流量
     */
    public  String unSerialize(byte[] parameterByte) {
        StringBuilder result =new StringBuilder("");
        ByteArrayInputStream tStream = new ByteArrayInputStream(parameterByte);
        ByteArrayOutputStream tp = new ByteArrayOutputStream();
        String key = null;
        byte[] lenB = new byte[4];
//        Object var6 = null;

        try {
            ByteArrayInputStream inputStream = tStream;

            while(true) {
                while(true) {
                    byte t = (byte)inputStream.read();
                    if (t == -1) {
                        tp.close();
                        tStream.close();
                        inputStream.close();
                        return result.toString();
                    }

                    if (t == 2) {
                        key = tp.toString();
                        inputStream.read(lenB);//读后面四个字节
                        int len = (lenB[0] & 255) | ((lenB[1] & 255) << 8) | ((lenB[2] & 255) << 16) | ((lenB[3] & 255) << 24);//读取“2”后面四个字节里面的内容，获取data的长度
                        byte[] data = new byte[len];
                        int readOneLen = 0;

                        while((readOneLen += inputStream.read(data, readOneLen, data.length - readOneLen)) < data.length) {
                        }

                        //data存在包含class文件的情况 如：加载内存马，此时还原data中的class文件
                        String henxStrings = bytesTohexString(data);
//                        System.out.println("class字节码文件的16进制信息："+henxStrings);
                        if(henxStrings.startsWith("cafe"))
                        {
                            FileOutputStream fos = new FileOutputStream(key+"Eval.class");
                            //字节数组data转换成16进制然后正则匹配cafe 来获取class的字节码
                            fos.write(data);
                            System.out.println("检查到非首次请求流量里面有class文件信息，已还原"+key+"Eval.class文件");
                            fos.flush();
                            fos.close();
                            result.append(key+"="+"还原文件根目录下:"+key+"Eval.class"+"\n");
                            tp.reset();
                        }
                        else {
                            result.append(key+"="+new String(data)+"\n");
                            tp.reset();
                        }

                    } else {
                        tp.write(t);
                    }
                }
            }
        } catch (Exception var11) {
            var11.printStackTrace();
            return "格式错误";
        }
    }

    /**
     * 16进制string转字节数组
     * @param hexString
     * @throws Exception
     * @return out
     */
    public   byte[] hexStringTobytes(String hexString){
        char[] data= hexString.toCharArray();
        int len = data.length;

        if ((len & 0x01) != 0) {
            throw new RuntimeException("Odd number of characters.");
        }

        byte[] out = new byte[len >> 1];

        // two characters form the hex value.
        for (int i = 0, j = 0; j < len; i++) {
            int f = toDigit(data[j], j) << 4;
            j++;
            f = f | toDigit(data[j], j);
            j++;
            out[i] = (byte) (f & 0xFF);
        }

        return out;

    }
    /**
     * 字节数组转16进制string
     * @param data
     * @throws Exception
     * @return hexString
     */
    public  String bytesTohexString(byte[] data ){
        StringBuilder r = new StringBuilder(data.length * 2);
        for (byte b : data) {
            r.append(hexCode[(b >> 4) & 0xF]);
            r.append(hexCode[(b & 0xF)]);
        }
        return r.toString();
    }

    /**
     * 将十六进制字符转换成一个整数
     *
     * @param ch
     *            十六进制char
     * @param index
     *            十六进制字符在字符数组中的位置
     * @return 一个整数
     * @throws RuntimeException
     *             当ch不是一个合法的十六进制字符时，抛出运行时异常
     */
    public  int toDigit(char ch, int index) {
        int digit = Character.digit(ch, 16);
        if (digit == -1) {
            throw new RuntimeException("Illegal hexadecimal character " + ch
                    + " at index " + index);
        }
        return digit;
    }


